import React from 'react';
import ProjData from './ProjData';

const ProjCard = (prop) =>{
    return (
        <>
                                <div className="col-md-4 col-12 mb-3">
                                    <div className="card card-carouse" style={{width: '18rem'}}>
                                        <img className="img-fluid" alt="100%x280" src={prop.imgsrc}/>
                                        <div className="card-body">
                                            <h4 className="card-title carouse-card-text">{prop.title}</h4>
                                            <p className="card-text">{prop.text}</p>
                                        </div>
                                      </div>
                                   </div>                     
        </>
    );
};
export default ProjCard;
